generated_text:
Det var det længste som jeg fik skrevet.
Danser omkring mig.
(There was the longest writing.
Dancing around me)

A long stretch was what I had;
the longest run that I could remember;
a long run with a cold sweat
from walking the desert;
then the desert turned to water;
a long walk by the shore
as I watched the ships passing
towards lands that I could never see;
from the water into the mountains;
a long mountain trail with no path
to follow but one made by the wind
as it blows all around;
to the sky from the ground
as I saw the birds flying;
up the clouds into the clear blue
as I went into the depth of space.

This is what I had dreamt of last night.
I saw the sun turn into the moon,
and the sky became a vast ocean.
